const ThemeClasses = ({ themesOptions, themeSelected }) => {
  let themeValue = themesOptions.find(
    (to) => to.themeValue === themeSelected
  ).themeValue;

  return (
    <>
      <div className='containerFluid1 container1-lg'>
        <div className='mainTitle pb2'>
          <h5 className='fontStyle fsH3'>Font Family:</h5>
        </div>

        <div className='row'>
          <div className='col3 fontDefault'>
            <h5 className='fsMD'>fontDefault:</h5>
          </div>
          {themesOptions.map((thClass) => (
            <>
              <div key={thClass.id}>
                <div className='col9 fontDefault'>
                  {thClass.themeValue === themeSelected
                    ? thClass.themeClasses.fontDefault
                    : ''}
                </div>
              </div>
            </>
          ))}
        </div>
      </div>
    </>
  );
};

export default ThemeClasses;
